import web from "../src/images/web.jpeg";
import app from "../src/images/app.jpeg";
import software from "../src/images/software.jpeg";
import digital from "../src/images/digital.jpeg";
import android from "../src/images/android.jpeg";
import marketing from "../src/images/marketing.jpeg";

const Sdata = [
  {
    imgsrc: web,
    title: "Web Development",
    description: "We provide the best web development service",
  },
  {
    imgsrc: app,
    title: "App Development",
  },
  {
    imgsrc: software,
    title: "Software Development",
  },
  {
    imgsrc: digital,
    title: "Digital Marketing",
  },
  {
    imgsrc: android,
    title: "Android Development",
  },
  {
    imgsrc: marketing,
    title: "Marketing",
  },
];

export default Sdata;
